import React from "react";
import { Grid, Card, CardContent, Typography, Button } from "@mui/material";
import { useNavigate } from "react-router-dom";
import "../styles/home.css";
import clgLogo from "../assets/CLG_LOGO.png";
import clubLogo from "../assets/clublogo.png";
import sympoLogo from "../assets/SYMPO.jpg";

const Home = () => {
  const navigate = useNavigate();

  const options = [
    {
      title: "Register Now",
      description: "Join Innovation Ignite Symposium and be part of the creative tech community.",
      action: () => window.open("https://your-registration-link.com", "_blank"),
    },
    {
      title: "Symposium Rulebook",
      description: "View the complete symposium rules and event guidelines.",
      action: () => window.open("/SympoRulebook.pdf", "_blank"),
    },
    {
      title: "Quiz Competition",
      description: "Test your technical and logical skills in our interactive quiz competition.",
      action: () => window.open("/QuizRulebook.pdf", "_blank"),
    },
    {
      title: "Mini Hackathon",
      description: "Showcase your coding talent by solving real-world problems in the hackathon.",
      action: () => window.open("/HackathonRulebook.pdf", "_blank"),
    },
    {
      title: "Model Presentation",
      description: "Present your innovative projects and engineering models to industry experts.",
      action: () => window.open("/ModelRulebook.pdf", "_blank"),
    },
  ];

  return (
    <div className="home-container">
      <div className="home-header">
        <img src={clgLogo} alt="College Logo" className="college-logo" />
        <div className="logo-row">
          <img src={clubLogo} alt="Club Logo" className="round-logo" />
          <img src={sympoLogo} alt="Sympo Logo" className="round-logo" />
        </div>
        <Typography variant="h3" className="title">
          Innovation Ignite Symposium
        </Typography>
      </div>

      <Grid container spacing={3} justifyContent="center" className="button-grid">
        {options.map((opt, i) => (
          <Grid item xs={10} sm={6} md={4} key={i}>
            <Card className="option-card" onClick={opt.action}>
              <CardContent>
                <Typography variant="h5" gutterBottom>
                  {opt.title}
                </Typography>
                <Typography variant="body2">{opt.description}</Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      <div className="contact-section">
        <Typography variant="h5" gutterBottom>
          Contact Us
        </Typography>
        <Typography>
          For any queries regarding registration, events, or participation, reach out to our team.
        </Typography>
        <Button
          variant="contained"
          color="primary"
          sx={{ mt: 2, borderRadius: "10px" }}
          onClick={() => navigate("/contact")}
        >
          Go to Contact Page
        </Button>
      </div>

      <footer>Â© 2025 Innovation Ignite Symposium | All Rights Reserved</footer>
    </div>
  );
};

export default Home;
